    uint256 constant IC0y =
        11554912338212917390036268018384973881785839228998788877630179212693440402150;

    uint256 constant IC1x =
        12075396998514496949781670596533795803895093806929265105280565711934337634449;
    uint256 constant IC1y =
        10750471308460640053341457603237468396396495464945292293054976691961439707005;

    uint256 constant IC2x =
        17961769515741887103876942476464852894358643278856171376774166643160316987712;
    uint256 constant IC2y =
        9334205258290778423037816696487646312307136383840414990481865529754115298526;

    uint256 constant IC3x =
        3273518438976530152026810514651683155811133125137401593225349481285195617134;
    uint256 constant IC3y =
        9531407699522633978114972556345287605062814388409488591602202201392559515431;

    // Memory data
